import { CardGrid, Div } from "@vkontakte/vkui"
import './index.css'

const QuestionItem = ({
    id,
    title,
    questionsLength
}) => {
    return <CardGrid>
        <Div>
            {title}
        </Div>
    </CardGrid>
}

export default QuestionItem
